// 评估单棵树
function evaluateTree(tree, input) {
    let node = tree;
    while (true) {
        if ('leaf' in node) {
            return node.leaf;
        }
        
        const value = input[node.split_feature];
        if (value <= node.split_condition) {
            node = node.yes;
        } else {
            node = node.no;
        }
    }
}
